import React, { useState } from "react";
import { HashRouter, Route } from "react-router-dom";
import css from "./App.css";
import Navigation_User from "./Components/Navigation_User";
import Navigation from "./Components/Navigation";
import Home from "./routes/Home";
import Myspace from "./routes/Myspace";
import Signin from "./routes/Signin";
import {nickname} from './routes/Signin'

function App() {
  const [username, setUsername] = useState(null);
  const authenticated = username != null;

  const login = () => setUsername({nickname});

  return (
    <>

      <HashRouter>
        <Navigation_User />
        <Route path="/" exact={true} component={Home} />
        <Route path="/myspace/create" component={Myspace} />
        <Route path="/signin" component={Signin} />
      </HashRouter>

    </>
  );
}

export default App;
